import Container from '@mui/material/Container';
import CopyrightIcon from '@mui/icons-material/Copyright';

import './Footer.css';
import resumeData from '../../utils/resumeData';

export default function Footer() {

    return(
        <Container maxWidth="xl" className='footer'>
            <h6 className='text_left' sx={{ flexGrow: 1 }}>{resumeData.name}.</h6>
            <div className='text_right' sx={{ flexGrow: 1 }}><CopyrightIcon className='copyright' />  2023 All rights reserved. Idea by tavonline</div>
        </Container>
    );

}
